  <script type="text/javascript">
    //入户空间	          4.2+0.48   1.8-0.3  面积7.02
    //主体部分(加0.3m屋檐)	13.04	9.36	面积122.0544

    const basic=100,//倍数
        left=120,//离左边距离
        _top=80,//离上边距离
        outer=0.3*basic,//屋檐
        wall24=0.24*basic,//24墙壁
        wall12=0.12*basic, //12墙壁
        width= 13.04*basic,//总宽
        length=9.36*basic,//总进深
        ting=4.2*basic,//客厅宽
        lang=1.8*basic,//入户进深
        room1Width=3*basic,//外边左边卧室宽度
        roomOuterLength=3.6*basic,//外边卧室进深
        roomInLength=3*basic,//里侧卧室进深
        walk=1.2*basic,//客厅去卧室走廊宽度
        wc=1.4*basic,//主厕所宽度
        wcroomWidth=1.2*basic,//主卧卫生间宽度
        wcroomLength=2.6*basic,//主卧卫生间进深
        room2Width=(3.08+1.2+0.12)*basic,//外边右边卧室宽度
        room3width=3.2*basic;//卫生间旁边卧室宽度

    function drawBasic(ctx){
        //外沿轮廓
        //ctx.beginPath()
        ctx.fillStyle="gray"
        //ctx.lineWidth=outer
        ctx.fillRect(0+left,0+_top,width,length);
        
        //走廊
        ctx.fillStyle="orange"
        ctx.fillRect(outer+left,length+_top-outer,ting+2*wall24,lang);
    
        //主体
        ctx.fillStyle="black"
        ctx.fillRect(outer+left,outer+_top,width-2*outer,length-2*outer);

        //客厅
        ctx.fillStyle="white"
        ctx.fillRect(
            outer+left+wall24,
            outer+_top+wall24,
            ting,
            length-2*outer-wall24*2
        );

        //外部房间
        ctx.fillStyle="#faa755"
        ctx.fillRect(
            outer+left+wall24*2+ting,
            outer+_top+wall24*3+walk+roomInLength,
            room1Width,
            roomOuterLength
        );
        
        ctx.fillRect(
            outer+left+wall24*2+ting+room1Width+wall12,
            outer+_top+wall24*3+walk+roomInLength,
            room2Width,
            roomOuterLength
        );
       
        //走廊
        ctx.fillStyle="white"
        ctx.fillRect(
            outer+left+wall24+ting,
            outer+_top+wall24*2+roomInLength,
            width-2*outer-ting-wall24*2,
            walk
        );
    
        //洗手间
        ctx.fillStyle="blue"
        ctx.fillRect(outer+left+2*wall24+ting,outer+_top+wall24,wc,roomInLength);
    
        //里面房间
        ctx.fillStyle="#faa755"
        ctx.fillRect(
            outer+left+3*wall24+ting+wc,
            outer+_top+wall24,
            room3width,
            roomInLength
        );

        ctx.fillStyle="white"
        ctx.fillRect(
            outer+left+3*wall24+ting+wc+room3width+wall12,
            outer+_top+wall24,
            width-2*outer-ting-wc-room3width-4*wall24-wall12,
            roomInLength
        );

        //内卫
        ctx.fillStyle="black"
        ctx.fillRect(
            left+width-outer-wall24-wcroomWidth-wall12,
            outer+_top+wall24*2+roomInLength,
            wcroomWidth+wall12,
            wcroomLength+wall12
        );
        ctx.fillStyle="blue"
        ctx.fillRect(
            left+width-outer-wall24-wcroomWidth,
            outer+_top+wall24*2+roomInLength,
            wcroomWidth,
            wcroomLength
        );
    }
    function drawSize(ctx){
        ctx.strokeStyle="red"
        ctx.font="18px serif"
        ctx.strokeText(`坐标0 0,宽${width/basic}m 深${length/basic}m`,left,_top-10)
        
        //客厅
        ctx.strokeText(
            `坐标${(outer+wall24)/basic} ${(outer+wall24)/basic},`+
            `宽${ting/basic}m 深${(length-2*outer-wall24*2)/basic}m`,
            outer+left+wall24,
            outer+_top+wall24+20
        )

        //外卫生间
        ctx.strokeText(
            `坐标${(outer+wall24)/basic} ${(outer+wall24)/basic}`,
            outer+left+2*wall24+ting,
            outer+_top+wall24+20
        )
        ctx.strokeText(
            `宽${wc/basic}m 深${(roomInLength)/basic}m`,
            outer+left+2*wall24+ting,
            outer+_top+wall24+40
        )

        //内卫生间
        ctx.strokeText(
            `坐标${(left+width-outer-wall24-wcroomWidth)/basic} ${(outer+_top+wall24*2+roomInLength)/basic}`,
            left+width-outer-wall24-wcroomWidth,
            outer+_top+wall24*2+roomInLength+20
        )
        ctx.strokeText(
            `宽${wcroomWidth/basic}m 深${(wcroomLength)/basic}m`,
            left+width-outer-wall24-wcroomWidth,
            outer+_top+wall24*2+roomInLength+40
        )
        

        //外部房间
        ctx.strokeText(
            `坐标${(outer+wall24*2+ting)/basic} ${(outer+wall24*3+walk+roomInLength)/basic},`+
            `宽${room1Width/basic}m 深${(roomOuterLength)/basic}m`,
            outer+left+wall24*2+ting,
            outer+_top+wall24*3+walk+roomInLength+20
        )

        ctx.strokeText(
            `坐标${(outer+wall24*2+ting+room1Width+wall12)/basic} ${(outer+wall24*3+walk+roomInLength)/basic},`+
            `宽${room2Width/basic}m 深${(roomOuterLength)/basic}m`,
            outer+left+wall24*2+ting+room1Width+wall12,
            outer+_top+wall24*3+walk+roomInLength+20
        )
    
        //里面房间
        ctx.strokeText(
            `坐标${(outer+3*wall24+ting+wc)/basic} ${(outer+wall24)/basic},`+
            `宽${room3width/basic}m `+
            `深${(roomInLength)/basic}m`,
            outer+left+3*wall24+ting+wc,
            outer+_top+wall24+20
        )

        ctx.strokeText(
            `坐标${(outer+3*wall24+ting+wc+room3width+wall12)/basic} ${(outer+wall24)/basic},`+
            `宽${(width-2*outer-ting-wc-room3width-4*wall24-wall12)/basic}m` +
            `深${(roomInLength)/basic}m`,
            outer+left+3*wall24+ting+wc+room3width+wall12,
            outer+_top+wall24+20
        )
    }

    function drawLine(ctx){
    	ctx.strokeStyle="red";
    	ctx.lineWidth=2;
    	ctx.beginPath();
    	ctx.moveTo(outer+left+wall24/2,_top+outer+wall24/2);
    	ctx.lineTo(width-outer+left-wall24/2,_top+outer+wall24/2);
    	ctx.lineTo(width-outer+left-wall24/2,length+_top-outer-wall24/2);
    	ctx.lineTo(outer+left+wall24/2,length+_top-outer-wall24/2);
    	ctx.closePath()
    	ctx.stroke()
    	ctx.font="18px serif"
    	ctx.strokeText(
	    	width-outer+left-wall24/2-(outer+left+wall24/2),
	    	(width-outer+left-wall24/2)/2,
	    	_top+outer+wall24/2
    	)
    	ctx.strokeText(
	    	length+_top-outer-wall24/2-(_top+outer+wall24/2),
	    	outer+left+wall24/2,
	    	(length+_top-outer-wall24/2)/2
    	)

    	ctx.beginPath();
    	
    	
    }



    //地基开挖图
    var domdj = document.getElementById('canvas-dj');
    domdj.style.cssText="border:1px solid gray;"
    domdj.width=1600;
    domdj.height=1400;
    var ctxdj = domdj.getContext('2d');
    drawBasic(ctxdj);
    drawLine(ctxdj)
    
    //画平面图
    var dompm = document.getElementById('canvas-pm');
    dompm.style.cssText="border:1px solid gray;"
    dompm.width=1600;
    dompm.height=1400;
    var ctxpm = dompm.getContext('2d');
    drawBasic(ctxpm);
    drawSize(ctxpm)

    //屋顶图
    var domwd = document.getElementById('canvas-wd');
    domwd.style.cssText="border:1px solid gray;"
    domwd.width=1600;
    domwd.height=1400;
    var ctxwd = domwd.getContext('2d');
    drawBasic(ctxwd);
  </script>
</body>
